import React from 'react';
import { Link, useNavigate } from 'react-router-dom';
import './HomeNavbar.css'; // Make sure to create the corresponding CSS file or adjust as needed

const Navbar = () => {
  const navigate = useNavigate();

  const handleLogout = () => {
    // Add your logout logic here
    // For example, clear user session, local storage, etc.
    navigate('/');
  };

  return (
    <header id=''>
      <nav className="navbar">
        <Link to="/" className="navbar-logo">
          <img className="logo" src="./assets/img/logo.png" alt="Logo" />
        </Link>
        <button className="hamburger-menu">
          <span className="hamburger"></span>
        </button>
        <ul className="navbar-menu">
          <li className="navbar-link">
            <Link to="/create-report">Create Record</Link>
          </li>
          <li className="navbar-link">
            <Link to="/view-reports">My Records</Link>
          </li>
          <li className="navbar-link active">
            <Link to="/dashboard">Dashboard</Link>
          </li>
          <li className="navbar-link" id="logout">
            <button onClick={handleLogout}>Logout</button>
          </li>
        </ul>
      </nav>
    </header>
  );
};

export default Navbar;
